    'featured_listings.AdditionalTermsForFeaturedAds': 'Regleman Adisyonel pou Piblikasyon Spesyal',
    'featured_listings.AdditionalTermsForFeaturedAds_content': 'Kondisyon an plis sa yo, an plis de<<LINK_TERMS_USE>>Kondisyon Itilizasyon<</LINK_TERMS_USE>> sit la, kouvri itilizasyon Anons Spesyal yo:<br /><ul><li>K\xF2m pr\xE8v peman pou yon Anons Spesyal, OLX nou pral bay yon "Konfimasyon K\xF2mand" ou pral w\xE8 nan fen pwosesis peman an ak yon konfimasyon pa im\xE8l.</li><li>Si pou yon rezon, kit se teknik oubyen nenp\xF2t rezon, anons ou a pa par\xE8t sou kote "Anons Spesyal " la, s\xE8l obligasyon OLX se mete anons ou an nan kote "Anons Spesyal" la  tou swit l\xE8 sa pratik pou nou.</li><li>Yon l\xF2t konpayi kapab regle zaf\xE8 faktirasyon pou nou.</li><li>Nan jijmanOLXs\xE8lman, nenp\xF2t anons ki ofanse, genyen bagay ki gen rap\xF2 ak s\xE8ks oubyen moun toutouni, spam (ak menm anons la de fwa landan yo), bagay ki kapab rak\xE8t oubyen vyole nenp\xF2t dwa ot\xE8 pa pral par\xE8t epi yo ap ranbouse peman an.</li><li>SEVIS ANONS ESPESYAL SA A SE "JAN LI YE A" OUBYEN "JAN LI DISPONIB" NOU OFRI LI, SAN OKENN GARANTI DAPRE LALWA.  OLX PA FE OKENN GARANTI OUBYEN REPREZANTASYON EPI LI PA ASIME OKENN RESPONSABLITE SOU SI ANONS SPESYAL YO EGZAKT OUBYEN KONPLE.</li></ul>',
    'featured_listings.Benefits': 'Avantaj',
    'featured_listings.Benefits_content': 'Pwiske yo ap mete ou nan yon pi bon plas, anons ou an ap jwenn anpil vizit. Imaj sa yo ki anba a montre de kalite Anons Spesyal ki disponib yo.',
    'featured_listings.Feature': 'Spesyal',
    'featured_listings.FeaturedListings_Content': 'S\xE8vis sa p\xE8m\xE8t ou mete anons ou an nan yon plas spesyal pou yon pery\xF2d byen det\xE8mine ki f\xE8 plis moun w\xE8 ou epi garante ou jwenn plis repons toujou.',
    'featured_listings.FeatureMyListing': 'Prezante Anons mwen',
    'featured_listings.FeatureYourListingForUp20TimesVisibility': '<<LINK_FEATURED_LISTINGS>>Prezante Anons ou<</LINK_FEATURED_LISTINGS>>pou yo ka w\xE8 li jiska 20 fwa plis ank\xF2!',
    'featured_listings.HowDoesItWork': 'Kijan li Mache? ',
    'featured_listings.HowDoesItWork_New': 'Anons ki Sou T\xE8t yo ak Rezilta Rech\xE8ch Anons Espesyal yo, Anons Espesyal yo ap par\xE8t nan soukategori yo epi yap vire owaza pati tout Anons Espesyal ki nan soukategori ak z\xF2n nan. Nan tout ka, seleksyon Anons Espesyal la ap f\xE8t owaza pou p\xE8m\xE8t tout manm ki achte Anons Espesyal yo gen menm chans pou par\xE8t sou Sitw\xE8b la. Se sa ki f\xE8 li posib pou anons ou pa toujou par\xE8t nan seksyon Anons Espesyal li a.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'Kijan pou m achte plas Anons Spesyal?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'Ou ka achte yon Anons Espesyal nan d\xE8nye etap pwosesis piblikasyon an ki konfime anosn ou a te pibliye oswa mesaj OLX ap voye pou ou a. Pwosesis sa a dir\xE8k. Ou ka chwazi konbyen sem\xE8n ou vle anons la par\xE8t. Ou prale sou paje peman an ak plizy\xE8 chwa peman. Apre ou fin f\xE8 peman an, w ap resevwa yon konfimasyon ki di anons ou a disponib pou tan ou te chwazi a. Si anons ou a respekte kondisyon pou itilize OLX yo, w ap resevwa yon im\xE8l konfimasyon. Nou vle ou konnen nou pa bay ranbousman pou okenn anons espesyal ou te achte. Tout Anons Espesyal ou achte final.',
    'featured_listings.HowDoIFeatureMyAd': 'K\xF2man pou m prezante anons mwen an tankou yon anons spesyal?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': 'Pou konbyen tan anson mwen an ap par\xE8t nan seksyon Anons Spesyal yo.',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings_content': 'Nou vann Anons Spesyal yo pa s\xE8men (7 jou). Ou ka prezante anons ou yo  pou jiska 4 sem\xE8n oubyen renouvle Anons Spesyal ou jiskaske ou f\xE8men anons lan.',
    'featured_listings.HowMuchDoesItCost': 'Konbyen k\xF2b li koute? ',
    'featured_listings.HowMuchDoesItCost_New': 'Sou t\xE8t Anons la ak Anons Espesyal Rezilta Rech\xE8ch koute <<LISTING_OTHER_CATS_FEATURED_PRICE>> pa sem\xE8n.Ou ka chwazi kantite tan ou vle anons ou pa par\xE8t sou t\xE8t Anons yo ak Rezilta Rech\xE8ch yo pou jiska 4 sem\xE8n.',
    'featured_listings.HowMuchVisitsWillIncrease': 'A konbyen vizit anons mwen yo pral ogmante?',
    'featured_listings.HowMuchVisitsWillIncrease_content': 'Objektif Anons Spesyal se ogmante konbyen fwa yo w\xE8 Anons ou an. <br />Yon etid nou te fe anndan an montre ke ke Anons Spesyal, jeneral, <strong>8 fwa plis moun ap w\xE8 anons ou konpare ak anons regilye. </strong>. Nan kategori ki genyen plis anons yo ou ka genyen jiska 20 fwa plis vizibilite.',
